import React, { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [movies, setMovies] = useState(null);

  useEffect(() => {


  }, [])

  useEffect(() => {
    axios.get("https://api.themoviedb.org/3/movie/334?api_key=721e6d30945061e57c30f65c44877cf8")
      .then(response => {
        console.log(response.data);
        setMovies(response.data);
      })
  }, [])
  return movies !== null ? (
    <div className="App">
      <p>{movies.original_title}</p>
      <img src={movies.poster_path} alt="picture"/>
      <p>{movies.overview}</p>
      <a href = {movies.homepage}>Lien du film</a>

    </div>
  ) : (
      <p>Pas de data</p>
    )
}

export default App;
